import React from 'react';
import { useParams } from 'react-router-dom';
import UploadDocument from './UploadDocument'; // Adjust the path accordingly
import DocumentList from './DocumentList'; // Adjust the path accordingly

const DocumentManagementPage = () => {
    const { userId } = useParams(); // Get userId from URL

    return (
        <div>
            <h2>Document Management for User {userId}</h2>
            <DocumentList userId={userId} />
            <UploadDocument userId={userId} />
        </div>
    );
};

export default DocumentManagementPage;
